import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={styles.navbar}>
      {/* Left side */}
      <div style={styles.left}>
        <div style={styles.logo}>
          <Link to="/" style={styles.logoLink}>QuizApp</Link>
        </div>
        <ul style={styles.navLinks}>
          <li><Link to="/" style={styles.link}>Dashboard</Link></li>
          <li><Link to="/profile" style={styles.link}>Profile</Link></li>
          <li><Link to="/settings" style={styles.link}>Settings</Link></li>
          <li><Link to="/past-quizzes" style={styles.link}>Past Quizzes</Link></li>
          <li><Link to="/upcoming-quizzes" style={styles.link}>Upcoming Quizzes</Link></li>
        </ul>
      </div>

      {/* Right side */}
      <div style={styles.right}>
        <Link to="/login" style={{ ...styles.button, marginRight: "10px" }}>Login</Link>
        <Link to="/signup" style={styles.button}>Signup</Link>
      </div>
    </nav>
  );
}

const styles = {
  navbar: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 20px",
    backgroundColor: "#4CAF50",
    color: "#fff",
    fontFamily: "Arial, sans-serif",
  },
  left: {
    display: "flex",
    alignItems: "center",
  },
  logo: {
    fontSize: "20px",
    fontWeight: "bold",
    marginRight: "30px",
  },
  logoLink: {
    textDecoration: "none",
    color: "#fff",
  },
  navLinks: {
    listStyle: "none",
    display: "flex",
    gap: "20px",
    margin: 0,
    padding: 0,
  },
  link: {
    textDecoration: "none",
    color: "#fff",
    fontWeight: "bold",
  },
  right: {
    display: "flex",
    alignItems: "center",
  },
  button: {
    padding: "8px 15px",
    borderRadius: "5px",
    textDecoration: "none",
    backgroundColor: "#fff",
    color: "#4CAF50",
    fontWeight: "bold",
  },
};

export default Navbar;
